  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0127092 contains raw underway
  meteorological, navigational, physical, profile and time series data logged by the
  Scientific Computer System (SCS) aboard NOAA Ship Ronald H. Brown in the North Pacific
  Ocean and South Pacific Ocean from 2015-02-27 to 2015-03-30. Office of Marine and
  Aviation Operations (OMAO) personnel aboard the ship submitted these data and associated
  metadata to NODC. In addition, NODC Accession 0127092 contains supplementary cruise-level
  metadata, which OMAO personnel logged in the Ship Daily Activity Log (SDAL). OMAO
  and NODC personnel developed the automated process to archive these data under the
  auspices of the NOAA Rolling Deck to Repository (NOAA R2R) program.\",\n\t\"owner_org\":
